import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { getSpecializimi } from '../../actions/SpecializimiActions';
import { useParams } from 'react-router-dom';
import { getUser } from '../../actions/userActions';
const UserProfile = () => {
    const dispatch = useDispatch();
    const userProfile = useSelector(state => state.useReducerContent.user);
    const errors = useSelector(state => state.errorReducerContent);
    const [spitaliData, setSpitaliData] = useState({
        id: "",
      });

    useEffect((event) => {
        event.preventDefault();
        const updateSpitaliObject = {
          id: spitaliData.id,
        };
            dispatch(getUser(updateSpitaliObject));
    }, [dispatch, updateSpitaliObject]);


    return (
        <div>
     
            <h1>Specializimi i Mjekut</h1>
            {userProfile ? (
                <div>
                    <h1>{user.id}</h1>
                    <h2>Emri: {user.fullName}</h2>
                    <h2>Email: {user.email}</h2>
                    <h2>{user.password}</h2>
                    <h2>Roli: {user.role}</h2>
                    <h2>Mobile: {user.mobile}</h2>
                </div>
            ) : (
                <p>Nuk u gjet asnjë specializim për këtë mjek.</p>
            )}
        </div>
    );
};

export default UserProfile;
